import React from 'react'
import { connect } from 'react-redux';
import Pentagon from '../images/bg-triangle.svg'
function ScoreTable({user, score}) {
  return (
    <div>
      <img src={Pentagon}/>
    </div>
  )
}

const mapStateToProps = (state) => {
  return {
    user: state.user,
    score: state.score
  };
};

export default connect(mapStateToProps)(ScoreTable);
